script: |
  super -f text -I q11632.spq | sort > q11632.out

inputs:
  - name: q11632.spq
    data: |
      SELECT ALL + col1 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE col2 NOT BETWEEN - + col2 * CAST ( NULL AS INTEGER ) * - col1 AND ( + col0 - col2 );
  - name: tab1

outputs:
  - name: q11632.out
    data: |
      14
      47
      5
